import './App.css'
import axios from "axios";
import { useEffect, useState } from "react";

import WeatherCardMain from './components/WeatherCardMain/WeatherCardMain';
import WeatherCardSide from './components/WeatherCardSide/WeatherCardSide';


const API_KEY:string = process.env.REACT_APP_API_KEY as string;
// const APIKEY:string = process.env.REACT_APP_API_KEY1 as string;
const  App = () =>{

  const [weatherData,setWeatherData] = useState<any>('')

  async function fetchWeather(city:string){
    try{
      const response =  await axios.get(`http://api.weatherapi.com/v1/marine.json?key=${API_KEY}&q=${city}&days=5`)
      setWeatherData(response.data)
      console.log(response.data)
    }catch (error){
      console.log(error)
    }

  }


  useEffect(()=>{
    fetchWeather('Taranto')
  },[])


  return (
    <div className='card'>
      {/* <WeatherCardMain  data = {weatherData}/> */}
      <WeatherCardSide/>
    </div>


  );
}

export default App;
